import {
  Dvr,
  Apartment,
  MedicalServices,
  School,
  Assessment,
} from "@mui/icons-material";

const pages = [
  {
    id: "digitalization",
    title: "Цифровізація",
    menuTitle: "Цифровізація",
    type: "collapse",
    icon: <Dvr />,

    children: [
      {
        id: "all",
        title: "Цифровізація - загальна",
        menuTitle: "Загальна",
        type: "item",
        url: "/digitalization/all",
        charts: [
          {
            id: "a",
            size: "xs",
            location: { x: 0, y: 0 },
          },
        ],
        target: true,
      },
      {
        id: "cnap",
        title: "ЦНАП",
        menuTitle: "ЦНАП",
        type: "item",
        url: "/digitalization/cnap",
        target: true,
      },
      {
        id: "inclusive",
        title: "Інклюзивність",
        menuTitle: "Інклюзивність",
        type: "item",
        url: "/digitalization/inclusive",
        target: true,
      },
    ],
  },
  {
    id: "infrastructure",
    title: "Інфраструктура",
    menuTitle: "Інфраструктура",
    type: "collapse",
    icon: <Apartment />,

    children: [
      {
        id: "all",
        title: "Інфраструктура - загальна",
        menuTitle: "Загальна",
        type: "item",
        url: "/infrastructure/all",
        target: true,
      },
    ],
  },
  {
    id: "healthcare",
    title: "Охорона здоров'я",
    menuTitle: "Охорона здоров'я",
    type: "collapse",
    icon: <MedicalServices />,

    children: [
      {
        id: "all",
        title: "Охорона здоров'я - загальна",
        menuTitle: "Загальна",
        type: "item",
        url: "/healthcare/all",
        target: true,
      },
    ],
  },
  {
    id: "education",
    title: "Освіта",
    menuTitle: "Освіта",
    type: "collapse",
    icon: <School />,

    children: [
      {
        id: "all",
        title: "Освіта- загальна",
        menuTitle: "Загальна",
        type: "item",
        url: "/education/all",
        target: true,
      },
    ],
  },
  {
    id: "economy",
    title: "Економіка",
    menuTitle: "Економіка",
    type: "collapse",
    icon: <Assessment />,

    children: [
      {
        id: "all",
        title: "Економіка - загальна",
        menuTitle: "Загальна",
        type: "item",
        url: "/economy/all",
        target: true,
      },
    ],
  },
];

export default pages;
